def δ (x : ℕ) : ℕ :=
  let divisors := {d ∈ finset.range (x + 1) | d % 2 = 1 ∧ d ∣ x}
  finset.max' divisors (finset.nonempty_of_mem (finset.mem_filter.mpr ⟨finset.mem_range.mpr (nat.succ_pos x), one_dvd x⟩))

def δ (x : ℕ) : ℕ :=
  if h : x > 0 then
    let odd_divisors := {d ∈ (Set.Icc 1 x) | d % 2 = 1 ∧ d ∣ x}
    Classical.some (Set.exists_maximal odd_divisors)
  else 0
